import styled from "styled-components";
import ShowMenuButton from "./ShowMenuButton";

const StyledShowMenuButton = styled(ShowMenuButton)`
  @media (max-width: 1px) {
    display: block;
  }
  position: fixed;
  bottom: 10px;
  right: 10px;
  display: none;
`;

export default StyledShowMenuButton;
